        function decryptContent() {
            const password = document.getElementById('password').value;
            const wrapper = document.querySelector('.wrapper');

            if (!password) {
                alert('Please provide a password.');
                return;
            }

            try {
                const salt = encryptedContent.slice(0, 16);
                const iv = encryptedContent.slice(16, 32);
                const ciphertext = encryptedContent.slice(32);

                const encoder = new TextEncoder();
                const keyMaterial = encoder.encode(password);
                window.crypto.subtle.importKey(
                    'raw',
                    keyMaterial,
                    { name: 'PBKDF2' },
                    false,
                    ['deriveKey']
                ).then(baseKey => {
                    return window.crypto.subtle.deriveKey(
                        {
                            name: 'PBKDF2',
                            salt: salt,
                            iterations: 100000,
                            hash: 'SHA-256'
                        },
                        baseKey,
                        { name: 'AES-CBC', length: 256 },
                        false,
                        ['decrypt']
                    );
                }).then(cryptoKey => {
                    return window.crypto.subtle.decrypt(
                        { name: 'AES-CBC', iv: iv },
                        cryptoKey,
                        ciphertext
                    );
                }).then(decryptedBuffer => {
                    const decoder = new TextDecoder();
                    const plaintext = decoder.decode(decryptedBuffer);

                    if (plaintext.trim().startsWith('<!DOCTYPE html>')) {
                        // parse and apply title from first H1, if available
                        const parser = new DOMParser();
                        const doc = parser.parseFromString(plaintext, 'text/html');
                        const h1 = doc.querySelector('h1');
                        if (h1 && h1.textContent) {
                            document.title = h1.textContent.trim();
                        }

                        const container = document.createElement('div');
                        container.innerHTML = plaintext;
                        document.body.innerHTML = '';
                        document.body.appendChild(container);
                    } else {
                        throw new Error('Decrypted content is not valid HTML.');
                    }
                }).catch(error => {
                    throw error;
                });
            } catch (error) {
                throw error;
            }
        }

        document.getElementById('password').addEventListener('keypress', function(event) {
            if (event.key === 'Enter') {
                decryptContent();
            }
        });
